/**
 * @brief crc32 computes the CRC32 check value of an input data.
 * @tparam W byte number of input data, the value of W includes 1, 2, 4, 8, 16.
 * @param crcInitStrm initialize crc32 value
 * @param inStrm input messages to be checked
 * @param inPackLenStrm effetive lengths of input message pack, 1~W. 0 means end of message
 * @param endInPackLenStrm end flag of inPackLenStrm, 1 "false" for 1 message, 1 "true" means no message anymore.
 * @param outStrm crc32 result to output
 * @param endOutStrm end flag of outStrm
 */
template <int W>
void crc32(hls::stream<ap_uint<32> >& crcInitStrm,
           hls::stream<ap_uint<8 * W> >& inStrm,
           hls::stream<ap_uint<5> >& inPackLenStrm,
           hls::stream<bool>& endInPackLenStrm,
           hls::stream<ap_uint<32> >& outStrm,
           hls::stream<bool>& endOutStrm) {
#pragma HLS array_partition variable = internal::table16 dim = 1 block factor = W
#pragma HLS bind_storage variable = internal::table16 type = rom_np impl = lutram
    bool e = endInPackLenStrm.read();
    while (!e) {
        ap_uint<5> inPackLen = inPackLenStrm.read();

        ap_uint<32> crc = crcInitStrm.read();
        ap_uint<8 * W> in_data;
        if (W == 1) {
            while (inPackLen == W) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                inPackLen = inPackLenStrm.read();
                crc = (crc >> 8) ^ internal::table16[0][crc(7, 0) ^ in_data];
            }
        } else if (W == 2) {
            while (inPackLen == W) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                inPackLen = inPackLenStrm.read();
                ap_uint<16> inTmp = in_data ^ crc(15, 0);
                crc = crc(31, 16) ^ internal::table16[0][inTmp(15, 8)];
                crc ^= internal::table16[1][inTmp(7, 0)];
            }
            if (inPackLen != 0) {
                in_data = inStrm.read();
                crc = (crc >> 8) ^ internal::table16[0][crc(7, 0) ^ in_data.range(7, 0)];
                inPackLen = inPackLenStrm.read();
            }
        } else {
            while (inPackLen == W) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                inPackLen = inPackLenStrm.read();
                const int NUM = W / 4;
                ap_uint<32> inTmp[NUM];
                for (int j = 0; j < NUM; j++) {
                    if (j == 0)
                        inTmp[j] = in_data(31 + 32 * j, 32 * j) ^ crc;
                    else
                        inTmp[j] = in_data(31 + 32 * j, 32 * j);
                }
                crc = internal::table16[0][inTmp[W / 4 - 1](31, 24)];
                for (int j = 1; j < W; j++) {
                    int index = j / 4;
                    int offset = j % 4;
                    crc ^= internal::table16[j][inTmp[W / 4 - 1 - index](31 - offset * 8, 24 - offset * 8)];
                }

                // crc = internal::table16[15][inTmp[0](7, 0)] ^ internal::table16[14][inTmp[0](15, 8)] ^
                //      internal::table16[13][inTmp[0](23, 16)] ^ internal::table16[12][inTmp[0](31, 24)] ^
                //      internal::table16[11][inTmp[1](7, 0)] ^ internal::table16[10][inTmp[1](15, 8)] ^
                //      internal::table16[9][inTmp[1](23, 16)] ^ internal::table16[8][inTmp[1](31, 24)] ^
                //      internal::table16[7][inTmp[2](7, 0)] ^ internal::table16[6][inTmp[2](15, 8)] ^
                //      internal::table16[5][inTmp[2](23, 16)] ^ internal::table16[4][inTmp[2](31, 24)] ^
                //      internal::table16[3][inTmp[3](7, 0)] ^ internal::table16[2][inTmp[3](15, 8)] ^
                //      internal::table16[1][inTmp[3](23, 16)] ^ internal::table16[0][inTmp[3](31, 24)];
            }

            if (inPackLen != 0) {
                for (ap_uint<5> i = 0; i < inPackLen; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = W min = W
                    if (i == 0) in_data = inStrm.read();
                    crc = (crc >> 8) ^ internal::table16[0][crc(7, 0) ^ in_data.range(7 + 8 * i, 8 * i)];
                }
                inPackLen = inPackLenStrm.read();
            }
        }
        outStrm.write(~crc);
        endOutStrm.write(false);
        e = endInPackLenStrm.read();
    }
    endOutStrm.write(true);
}

/**
 * @brief crc32 computes the CRC32 check value of an input data.
 * @tparam W byte number of input data, the value of W includes 1, 2, 4, 8, 16, 32, 64.
 * @param crcInitStrm initialize crc32 value
 * @param inStrm input messages to be checked
 * @param inLenStrm lengths of input message
 * @param endInStrm end flag of inLenStrm
 * @param outStrm crc32 result to output
 * @param endOutStrm end flag of outStrm
 */
template <int W>
void crc32(hls::stream<ap_uint<32> >& crcInitStrm,
           hls::stream<ap_uint<8 * W> >& inStrm,
           hls::stream<ap_uint<32> >& inLenStrm,
           hls::stream<bool>& endInStrm,
           hls::stream<ap_uint<32> >& outStrm,
           hls::stream<bool>& endOutStrm) {
#pragma HLS array_partition variable = internal::table64 dim = 1 block factor = W
#pragma HLS bind_storage variable = internal::table64 type = rom_np impl = lutram
    bool e = endInStrm.read();
    while (!e) {
        ap_uint<32> len = inLenStrm.read();
        e = endInStrm.read();

        ap_uint<32> crc = crcInitStrm.read();
        ap_uint<8 * W> in_data;
        if (W == 1) {
            for (uint64_t i = 0; i < len; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                crc = (crc >> 8) ^ internal::table64[0][crc(7, 0) ^ in_data];
            }
        } else if (W == 2) {
            for (uint64_t i = 0; i < len / W; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                ap_uint<16> inTmp = in_data ^ crc(15, 0);
                crc = crc(31, 16) ^ internal::table64[0][inTmp(15, 8)];
                crc ^= internal::table64[1][inTmp(7, 0)];
            }
            if (len % W) {
                in_data = inStrm.read();
                crc = (crc >> 8) ^ internal::table64[0][crc(7, 0) ^ in_data.range(7, 0)];
            }
        } else {
            for (uint64_t i = 0; i < len / W; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                const int NUM = W / 4;
                ap_uint<32> inTmp[NUM];
                for (int j = 0; j < NUM; j++) {
                    if (j == 0)
                        inTmp[j] = in_data(31 + 32 * j, 32 * j) ^ crc;
                    else
                        inTmp[j] = in_data(31 + 32 * j, 32 * j);
                }
                crc = internal::table64[0][inTmp[W / 4 - 1](31, 24)];
                for (int j = 1; j < W; j++) {
                    int index = j / 4;
                    int offset = j % 4;
                    crc ^= internal::table64[j][inTmp[W / 4 - 1 - index](31 - offset * 8, 24 - offset * 8)];
                }

                // crc = internal::table64[15][inTmp[0](7, 0)] ^ internal::table64[14][inTmp[0](15, 8)] ^
                //      internal::table64[13][inTmp[0](23, 16)] ^ internal::table64[12][inTmp[0](31, 24)] ^
                //      internal::table64[11][inTmp[1](7, 0)] ^ internal::table64[10][inTmp[1](15, 8)] ^
                //      internal::table64[9][inTmp[1](23, 16)] ^ internal::table64[8][inTmp[1](31, 24)] ^
                //      internal::table64[7][inTmp[2](7, 0)] ^ internal::table64[6][inTmp[2](15, 8)] ^
                //      internal::table64[5][inTmp[2](23, 16)] ^ internal::table64[4][inTmp[2](31, 24)] ^
                //      internal::table64[3][inTmp[3](7, 0)] ^ internal::table64[2][inTmp[3](15, 8)] ^
                //      internal::table64[1][inTmp[3](23, 16)] ^ internal::table64[0][inTmp[3](31, 24)];
            }
            for (uint64_t i = 0; i < len - (len / W) * W; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = W min = W
                if (i == 0) in_data = inStrm.read();
                crc = (crc >> 8) ^ internal::table64[0][crc(7, 0) ^ in_data.range(7 + 8 * i, 8 * i)];
            }
        }
        outStrm.write(~crc);
        endOutStrm.write(false);
    }
    endOutStrm.write(true);
}

/**
 * @brief crc32 computes the CRC32 check value of an input data.
 * @tparam W byte number of input data, the value of W includes 32, 64.
 * @param crcInitStrm initialize crc32 value
 * @param inStrm input messages to be checked
 * @param inPackLenStrm effetive lengths of input message pack, 1~W. 0 means end of message
 * @param endInPackLenStrm end flag of inPackLenStrm, 1 "false" for 1 message, 1 "true" means no message anymore.
 * @param outStrm crc32 result to output
 * @param endOutStrm end flag of outStrm
 */
template <int W>
void crc32(hls::stream<ap_uint<32> >& crcInitStrm,
           hls::stream<ap_uint<8 * W> >& inStrm,
           hls::stream<ap_uint<7> >& inPackLenStrm,
           hls::stream<bool>& endInPackLenStrm,
           hls::stream<ap_uint<32> >& outStrm,
           hls::stream<bool>& endOutStrm) {
#pragma HLS array_partition variable = internal::table64 dim = 1 block factor = W
#pragma HLS bind_storage variable = internal::table64 type = rom_np impl = lutram
    bool e = endInPackLenStrm.read();
    while (!e) {
        ap_uint<7> inPackLen = inPackLenStrm.read();

        ap_uint<32> crc = crcInitStrm.read();
        ap_uint<8 * W> in_data;
        if (W == 1) {
            while (inPackLen == W) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                inPackLen = inPackLenStrm.read();
                crc = (crc >> 8) ^ internal::table64[0][crc(7, 0) ^ in_data];
            }
        } else if (W == 2) {
            while (inPackLen == W) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                inPackLen = inPackLenStrm.read();
                ap_uint<16> inTmp = in_data ^ crc(15, 0);
                crc = crc(31, 16) ^ internal::table64[0][inTmp(15, 8)];
                crc ^= internal::table64[1][inTmp(7, 0)];
            }
            if (inPackLen != 0) {
                in_data = inStrm.read();
                crc = (crc >> 8) ^ internal::table64[0][crc(7, 0) ^ in_data.range(7, 0)];
                inPackLen = inPackLenStrm.read();
            }
        } else {
            while (inPackLen == W) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = 100 min = 100
                in_data = inStrm.read();
                inPackLen = inPackLenStrm.read();
                const int NUM = W / 4;
                ap_uint<32> inTmp[NUM];
                for (int j = 0; j < NUM; j++) {
                    if (j == 0)
                        inTmp[j] = in_data(31 + 32 * j, 32 * j) ^ crc;
                    else
                        inTmp[j] = in_data(31 + 32 * j, 32 * j);
                }
                crc = internal::table64[0][inTmp[W / 4 - 1](31, 24)];
                for (int j = 1; j < W; j++) {
                    int index = j / 4;
                    int offset = j % 4;
                    crc ^= internal::table64[j][inTmp[W / 4 - 1 - index](31 - offset * 8, 24 - offset * 8)];
                }

                // crc = internal::table64[15][inTmp[0](7, 0)] ^ internal::table64[14][inTmp[0](15, 8)] ^
                //      internal::table64[13][inTmp[0](23, 16)] ^ internal::table64[12][inTmp[0](31, 24)] ^
                //      internal::table64[11][inTmp[1](7, 0)] ^ internal::table64[10][inTmp[1](15, 8)] ^
                //      internal::table64[9][inTmp[1](23, 16)] ^ internal::table64[8][inTmp[1](31, 24)] ^
                //      internal::table64[7][inTmp[2](7, 0)] ^ internal::table64[6][inTmp[2](15, 8)] ^
                //      internal::table64[5][inTmp[2](23, 16)] ^ internal::table64[4][inTmp[2](31, 24)] ^
                //      internal::table64[3][inTmp[3](7, 0)] ^ internal::table64[2][inTmp[3](15, 8)] ^
                //      internal::table64[1][inTmp[3](23, 16)] ^ internal::table64[0][inTmp[3](31, 24)];
            }

            if (inPackLen != 0) {
                for (ap_uint<7> i = 0; i < inPackLen; i++) {
#pragma HLS PIPELINE II = 1
#pragma HLS loop_tripcount max = W min = W
                    if (i == 0) in_data = inStrm.read();
                    crc = (crc >> 8) ^ internal::table64[0][crc(7, 0) ^ in_data.range(7 + 8 * i, 8 * i)];
                }
                inPackLen = inPackLenStrm.read();
            }
        }
        outStrm.write(~crc);
        endOutStrm.write(false);
        e = endInPackLenStrm.read();
    }
    endOutStrm.write(true);
}

